    {
      "date": null,
      "tags_section": null,
      "ntokens": 14,
      "text": "26. Bey Hrn. Rudolf Ramsperger an der Huths gass ist extra guter Holländer-Taback in bleiernen Pfund-Büchsen à 10 Batzen, wie auch guter St. Vincent à 8 Bz. zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 18,
      "text": "27. Wer gute Art große Bohnen zum Sezen, und kleine weiße Bito zum Kochen in billigem Preis zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 24,
      "text": "28. Zween Barrellein oder Professor Huth, wie auch ein ganz neuer Caistor Huth, mittl. unläßiger Größe, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 20,
      "text": "29. Bey Hrn. Burkhardt zum Riesen sind extra neue große Italienische Feigen, bito große Meer-Trauben mit und ohne Stiel, Haselnuß, birre Merchelin, feine Chocoladen, alles in billigem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "30. Zwölf Säck neuer Waizen in billigem Preis, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 35,
      "text": "31. Bey Hrn. Jacob Grimm Buchbinder ist zu haben: 1) Kriegs-Atlas von 65 theils Land-Karten, Städten, Schlachten, Plans von Bataillen und Belagerungen des jetzigen Kriegs. 2) Die Welt in einer Nuß mit Kupfern. 3) Die Durchlauchige Welt, 4 Theil mit Waapen. 4) Journal du Camp de Compiègne avec figures."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 19,
      "text": "32. Sieben faubere frantzösische Bether in ein Wirths-Haus auf das Land oder in ein Bad diennlich, ohnentgeltlich in Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 32,
      "text": "33. Ein Behaußung in der Reßlerischen Vorstadt mit 4 Stuben, 5 Kammern samt einer großen Werstatt, Eßrig und einem schönen ge wölbten Keller und Garten, weßhalb sich bey Hrn. Jacob Mäglin dem Weinmann anzumelden."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 27,
      "text": "34. Ein Freund, welcher circa 600 Sefter Hanf-Samen andere leßern tonnte, möchte aber folchen vorher zu verkaufen wissen, offerier selbigen dahero in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 18,
      "text": "35. Wer guter alter weißer Wein zu haben, ist bey Hrn. Michael Fuchs den Küfer zu vernehmen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 20,
      "text": "36. Circa 6. Saunt ercia guter alter rother Pfeiffer-Wein, so gut als Neuenburger oder Burgunder, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 18,
      "text": "37. Zwei Stücklein weissen Wein von 1760, à 8 Pfund to ist der Saum im einsen, und à 8 Pfund im andern, wovon nach Belieben zu haben, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 26,
      "text": "38. Ein Stock Heu ab 3 Tannen Matten vorr Nichmeyer, Thor oberhalb der Schorenbrunnen, ferner ein Stücklein von 37 Saumen rothbeß Hölztern-Wein von 1760, schon roth- und lauter, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 18,
      "text": "39. Auf E. E. Zunft zum Bären sind wiederum einige saure Rüben in billigem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 20,
      "text": "40. Ein roth Scharlachen Camisol und Hofen in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "41. Im Offenburgers Hof ist wohlfeilerer Bau zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 18,
      "text": "42. Ein Brennhaußlein bey der Steinen-Mühlin mit aller Kommligkeit, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 26,
      "text": "43. Bey wemme rother und weißer Burgunder, wie auch Muscat-Wein, Piecenweis, wegas Mangel Pfaßes, wie auch roth und weißer 7säzger Margraffer-Wein in billigem Preis zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 22,
      "text": "44. Feine heitergelbe Hamburger-Strick-Wollen das Pfund à 6 Pfund, wo dieselbe Pfundweis zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 28,
      "text": "45. Herrn Holzach des Siegfrists Behaußung ins Spiegelgäßlein mit 4 Stuben, 3 Kammern sc. ist entweder zu verkaufen, oder samtehaft zu verlehnen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 19,
      "text": "46. Weiße und rothe Margraffer-Weine von 1760, wovon in billigem Preis nach Belieben zu haben, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 21,
      "text": "47. Ein Mannsbild in St. Peters Kirch auf dem Lettern. Item ein grün Tombau- und Bethlein mit grünen wellenen Umhängen, in Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 22,
      "text": "48. Ein Haußschlitten mit einem schönen Bild und Zugehör in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 24,
      "text": "49. Der Barenfelser-Hof zu St. Peter, mit Garten, Stallung, Keller sc. wie der Augen schein zeiget wird. In Ermangelung eines Käuffers"
    }
  ]
}
